function NavBar(){
  const logo = "Youness OFPPT 2A"

  const darkMode = () => {
    let bgColorNav = document.querySelector('nav').backgroundColor
    if(bgColorNav != "#000"){
      bgColorNav = "#000"
    }
  }
  return(
    <nav>
      <span> { logo }</span>
      <div className='links'>
        <a href='/'>Home</a>
        <a href='/react'>REACT JS</a>
        <a href='/laravel'>LARAVEL</a>
        <a href='/mySQL'>Procedural mySQL</a>
        <a href="/mongoDB">MongoDB</a>
        <a href="/uml">UML</a>
        <a href="/jira">JIRA</a>
        <a href="/Figma">FIGMA</a>
        <a href="/git">GIT / GITLAB</a>
        <a href="/mongoDB">MongoDB</a>
        <a href="/azure">AZURE</a>
        <button>Dark mode</button>


      </div>
    </nav>
  )
}


export default NavBar ;
